            <div className="stream">
                ankit
            </div>
        )
    }

    return <div className="header container-fluid" style={{zIndex:"2"}}>
    <div className="row">
        <div className="header-logo col-lg-2 col-md-2 col-sm-2">
            <img className="header-logo-img" src="https://www.freelogoservices.com/api/main/images/1j+ojFVDOMkX9Wytexe43D6kifWHqx5OmhzNwXs1M3EMoAJtlSkogvpu...fw7" />
    </div>
    <div className="col-lg-10 col-md-10 col-md-10 head-items-colect">
        <h3 style={{display:"inline"}}>
           <a href="" ><span className="header-items active" style={{textDecoration:"none"}}>Home</span> </a>
           <a href=""> <span className="header-items" onClick={(e) => handleStream(e)}>X Stream <i class="fas fa-chevron-down fa-0.5x"></i></span></a>
           <a href=""> <span className="header-items">News<i class="fas fa-chevron-down fa-0.5x"></i></span></a>
           <a href=""> <span className="header-items">Blog<i class="fas fa-chevron-down fa-0.5x"></i></span></a>
           <a href=""> <span className="header-items">About</span></a>
           
        </h3>
        <button class="button-head"><span>Get Started </span></button>
    </div>
    <div>{ stream ?Stm:null}</div>

        </div>
    </div>
}
export default Header;
